r($,"aU6","YO",()=>A.a([A.hC("What is OMBC daily? ","OMBC daily is a bread subscription service by the same bakers as the Old Madras Baking Company. As part of our dream to make freshly baked bread more accessible to you, we decided to deliver them straight from our ovens to your door steps. You need not worry about ever running out of fresh bread at home. You can conveniently subscribe online to enjoy fresh, high quality bread each day delivered to your home as often as you like. ",!1),A.hC("How can I order bread? ","Simply click on the OMBC Daily logo on the top right hand corner of our website and you will be guided through a quick 3 step subscription process. Follow the steps by choosing your location and type of breads. Check-out and fill in your billing information, which can be SAVED by logging in.",!1),A.hC("How often can I order my bread? ","Bread can be delivered 1, 2 or 3 times a week based on your needs. When you go through the subscription process you will be able to choose your frequency of delivery. ",!1),A.hC("What is the order policy? ","With each order a maximum of 3 loaves can be ordered and these are the loaves that will be repeated each delivery. You can always change the type of bread by logging into your account anytime. If you need more than 3 loaves per order, just drop by any of our stores and we can help you out.",!1),A.hC("How can I order bread?","Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in.",!1),A.hC("How does the OMBC wallet work? ","When you subscribe for OMBC Daily, you will enter the details of your order online. The amount you will be charged is for the entire month and after each delivery the amount will be deducted from your wallet. Once your credit reaches close to Rs.0 on you will receive an automatic email notification to recharge your wallet. ",!1),A.hC("What happens to my subscription when I am out of town? ","You can pause your subscription anytime and resume it upon your return. ",!1),A.hC("How can I terminate my subscription? ","You can terminate your subscription in the order history page under the history tab. ",!1),A.hC("When is the order cut off time? ","All orders are taken in before 4 pm the previous day. This gives us enough time to prepare our loafs for the following day. ",!1),A.hC("I am not at home when your delivery is scheduled, what do I do ? ","We understand that some of you might like to sleep in late or don\u2019t like opening doors in your sleeping gowns. We got you covered. Each subscription orders gets a personalized 100% certified organic cotton tote bag. All you need to do is hang this outside your main door or gate. We\u2019ll come drop off the bread in these bags so you can pick them when ever you are ready to collect them. Since your bread is prepaid using the wallet you don\u2019t to have worry about payments either. ",!1),A.hC("Are the ingredients 100% natural? ","All ingredients used in our breads are 100% natural and of the highest quality. They are as an in all our stores preservative free too. ",!1),A.hC("Is your bread whole wheat? ","Our wheat and cereal breads are made with 100% whole wheat ( locally known as atta ) unlike other stores that use a mix for their wheat breads. We pride ourselves in baking exactly what you ask for.",!1),A.hC("I have money in my wallet but don\u2019t want to continue with the subscription ?","It will be sad for us to see you go but fear not. Your money will be refunded in the form of a gift coupon that you can redeem at any of our stores or just make friends or family really happy by passing on the coupon to them for their use. Just remember to use the entire value in one go. ",!1)],A.ad("w<JC>")))
